import {createAsyncThunk} from "@reduxjs/toolkit";
import customAxios from "./api";

export const product1 = createAsyncThunk(
    'products/getProducts',
    async (page)=>{
        const res = await customAxios.get('products/category1');
        return res.data;
    }
)
